Nylon - February 2012

Nylon is an American magazine that focuses on pop culture and fashion. Its coverage includes art, beauty, music, design, celebrities, technology and travel. Its name references New York and London. With its unique sense of style and a keen pop culture sensibility, Nylon gives today's young woman a modern twist to fashion, beauty, music and more. The first Nylon cover subject was Liv Tyler in April 1999, photographed and interviewed by Helena Christensen. Cover models have included: Christina Aguilera, The Horrors, Lily Allen, Paris Hilton, The Kills, Camilla Belle, Karen O, Evan Rachel Wood, Mary-Kate Olsen, Zooey Deschanel, Kristen Stewart, Rachel Bilson, Scarlett Johansson, Mischa Barton, Christina Ricci, Leighton Meester, Blake Lively, Taylor Momsen, The White Stripes, Sienna Miller, Nicole Richie, Megan Fox, Hilary Duff, Emma Stone, Drew Barrymore, Jessica Szohr and Lindsay Lohan



